def repeatedSubstringPattern(s: str) -> bool:
    n = len(s)
    count:int = 0
    chunk:str = ""
    full_chunk:str = ""

    for i in range(n):
        for length in range(1, n - i + 1):
            chunk = s[i:i + length]
            
            # print(f"current_chunk:{chunk} count:{count} s:{s}")
            
            full_chunk = chunk * (len(s) // len(chunk))

            if full_chunk == s and length < len(s):
                return True
            

    return False

s = "abab"

assert repeatedSubstringPattern(s) == True

s = "aba"

assert repeatedSubstringPattern(s) == False

s = "abcabcabcabc"

assert repeatedSubstringPattern(s)  == True

s =""

assert repeatedSubstringPattern(s)  == True